Right now query : select city_id from hive-api-created_trips order by SecondsSinceEpoch limit 2
will give wrong results:
{
    "selectionResults": {
        "columns": ["city_id"],
        "results": [
            [null, "484"],
            [null, "195"]
        ]
    },
....
}
The reason is during render the results, we pre-assume the query result will have all the columns from data schema which is combined sorting columns and selected columns.

To fix this, we should use the number of selection columns to make the array size and fill in the values.

Right now, if we select columns not existed in a segment, then the entire segment will return null as response, so in the render steps, all the select columns must be in the data schema.
